import java.util.*;
import java.lang.Integer;
/**
* SortArrays
* 
* @author  Kerra McLeod
* @version 1.0
*/
public class SortArrays
{
   public static void main(String[] args)
   {
      Random random = new Random(); // creating Random object
      int[] array = new int[50000];
      for (int i = 0; i < array.length; i++) 
      {
         array[i] = random.nextInt(); // storing random integers in an array
      }
      int arrayLength = array.length;
      
      Date currentQuick = new Date(); // Get current time 
      long startTimeQuick = currentQuick.getTime();
      //Quick Sort method
      quickSort(array, 0, arrayLength - 1);
      currentQuick = new Date(); // Get current time 
      long stopTimeQuick = currentQuick.getTime(); 
      long elapsedTimeQuick = stopTimeQuick - startTimeQuick; // Milliseconds
      System.out.println("Quick Sorted array: ");
      printArray(array, arrayLength);
      System.out.println("Quicksort time: " + String.valueOf(elapsedTimeQuick) + " milliseconds.");
      
      Date currentSelection = new Date();
      long startTimeSelection = currentSelection.getTime();
      //Selection Sort method
      selectionSort(array, arrayLength);
      currentSelection = new Date(); 
      long stopTimeSelection = currentSelection.getTime(); 
      long elapsedTimeSelection = stopTimeSelection - startTimeSelection; // Milliseconds    
      System.out.println("Selection Sorted array: ");
      printArray(array, arrayLength);
      System.out.println("Selection Sort time: " + String.valueOf(elapsedTimeSelection) + " milliseconds.");
   }
   
   /** 
      Sorts the first n objects in an array into ascending order. 
      @param int[] array, int arrayLength
   */ 
   public static void selectionSort(int[] array, int arrayLength) 
   { 
      for (int index = 0; index < arrayLength - 1; index++) 
      { 
         int indexOfNextSmallest = getIndexOfSmallest(array, index, arrayLength - 1); 
         swap(array, index, indexOfNextSmallest); 
      // Assertion: a[0] <= a[1] <= . . . <= a[index] <= all other a[i]. 
      } // end for 
   } // end selectionSort 
 
    /** 
      Implements QuickSort
      @param int[] array: Array to be sorted, int low: starting index, int high: ending index.
   */
   public static void quickSort(int[] array, int low, int high)
   {
      if (low < high)
      { 
         int partitionIndex = partition(array, low, high);
      
        // Separately sort elements before
        // partition and after partition
         quickSort(array, low, partitionIndex - 1);
         quickSort(array, partitionIndex + 1, high);
      }
   }
   
   /** 
      Sorts array using last element as pivot. 
      @param int[] array, int low, int high
      @return int
   */
   public static int partition(int[] array, int low, int high)
   {
     
    // pivot
      int pivot = array[high];
     
    // Index of smaller element and
    // indicates the right position
    // of pivot found so far
      int i = (low - 1);
   
      for(int j = low; j <= high - 1; j++)
      {
         
        // If current element is smaller
        // than the pivot
         if (array[j] < pivot)
         {
             
            // Increment index of
            // smaller element
            i++;
            swap(array, i, j);
         }
      }
      swap(array, i + 1, high);
      return (i + 1);
   }
 
   /**
      Finds the index of the smallest value in a portion of an array a. 
      Precondition: a.length > last >= first >= 0.
      @param int[] array, int first, int last 
      @return the index of the smallest value among. 
   */  
   private static int getIndexOfSmallest(int[] array, int first, int last) 
   { 
      int minimum = array[first]; 
      int indexOfMinimum = first;
      for (int index = first + 1; index <= last; index++) 
      { 
         if (Integer.compare(array[index], minimum) < 0) 
         { 
            minimum = array[index]; 
            indexOfMinimum = index; 
         } // end if 
      // Assertion: min is the smallest of a[first] through a[index]. 
      } // end for 
   
      return indexOfMinimum; 
   } // end getIndexOfSmallest 
   
   /** 
      A utility function to swap two elements.
      @param int[] array, int i, int j
   */ 
   static void swap(int[] array, int i, int j)
   {
      int temp = array[i];
      array[i] = array[j];
      array[j] = temp;
   }
 
   /** 
      Function to print an array
      @param int[] array, int size
   */
   public static void printArray(int[] array, int size)
   {
      for(int i = 0; i < size; i++)
         System.out.print(array[i] + " ");
         
      System.out.println();
   }
}

